    def expected_amount_of_troops_left_for_attacker(self, attack_troops, defender_troops) -> float:

        # reduce to our probablity table
        if attack_troops > 100 or defender_troops > 100:
            reduction = max(attack_troops - 100, defender_troops - 100)
            attack_troops -= reduction
            defender_troops -= reduction

        if attack_troops <= 0: return 0.0
        if defender_troops <= 0: return 1.0

        string_to_search = str(attack_troops) + "," + str(defender_troops)
        return self.attacker_troops_left_table.get(string_to_search, 0.0)
    
    def update_target_continent(self, game: Game):
        """Update the target continent based on the current game state."""
        continents = game.state.map.get_continents()
        my_territories = game.state.get_territories_owned_by(game.state.me.player_id)

        # Calculate the percentage of each continent controlled by us
        continent_control = {}
        for continent, territories in continents.items():
            owned = len(set(territories) & set(my_territories))
            total = len(territories)
            continent_control[continent] = (owned / total, total - owned)

        for continent in continent_control:
            if continent_control[continent][0] == 1:
                # Don't choose this continent if it's already fully controlled
                continent_control[continent] = (-1, -1)

        # Determine the continent closest to being captured by us
        self.target_continent = max(continent_control, key=lambda x: (continent_control[x][0], -continent_control[x][1]))

    # assume: this is optimal 
    def heuristic(self, game: Game) -> float:
        """Get a heuristic value for the current game state for implementing minimax"""
        evaluation = 0
        my_territories = game.state.get_territories_owned_by(game.state.me.player_id)

        # We will place troops along the territories on our border.
        border_territories = game.state.get_all_border_territories(
            game.state.get_territories_owned_by(game.state.me.player_id)
        )

        bordering_territories = game.state.get_all_adjacent_territories(border_territories)
        enemy_territories = set(bordering_territories) - set(my_territories)
        
        # Border Security Threat = sum of # of neighboring enemy troops
        border_security_threat = sum([game.state.territories[t].troops for t in enemy_territories])

        for territory in border_territories:
            border_security_ratio = game.state.territories[territory].troops / border_security_threat
            evaluation += (1 / border_security_ratio)

        # enemy territory ratio part
        total_territories = len(game.state.territories)
        num_enemy_territories = sum(enemy_territories)
        evaluation += num_enemy_territories / total_territories
        return evaluation

